import { HeaderBox, Login, Logo, Title } from "../style";
import { LoginButton } from "../styles/Buttons";
import { MainTitle, TextIrish } from "../styles/TextStyles";
import { SearchBox } from "./SearchBox";

export const Header = ({ filter, setFilter }: any) => {
  return (
    <HeaderBox>
      <SearchBox filter={filter} setFilter={setFilter}></SearchBox>
      <Logo>
        <img
          src={require("../locales/images/logo.png")}
          alt="Ni ma loga"
          style={{ width: "45px", height: "45px" }}
        ></img>
      </Logo>
      <Title>
        <TextIrish>Food'n'go!</TextIrish>
      </Title>
      <Login>
        <LoginButton>Login</LoginButton>{" "}
        <LoginButton>Szczegóły zamówienia</LoginButton>
      </Login>
    </HeaderBox>
  );
};
